'use client'
import ReactECharts from "echarts-for-react";
import {selectableColor} from "@/app/(chart)/playtimeGraph";
import {random} from "lodash";
import {useEffect, useMemo, useState} from "react";

interface WordCloudProps {
  width: number;
  height: number;
  words: WordData[],
  className: string,
}

export interface WordData {
  text: string;
  value: number;
}



// const src = "data:image/svg+xml;utf8;base64,"
const src = "data:image/png;base64,"
export default function EchartWordCloud({ width, height,words,className}: WordCloudProps) {
  const data = useMemo(()=>{
    return  words.map(it=> ({
      name: it.text,
      value: it.value
    }))
  }, [words])


  // const [image, setImage] = useState(new Image())


  const option = useMemo(()=> {
    return {
      tooltip: {
        show: true,
        formatter: '{b}: {c}'
      },
      series: [{
        type: 'wordCloud',
        shape: 'circle',
        keepAspect: false,
        // maskImage: image,
        left: 'center',
        top: 'center',
        width: '100%',
        height: '100%',
        right: null,
        bottom: null,

        // Text size range which the value in data will be mapped to.
        // Default to have minimum 12px and maximum 60px size.

        sizeRange: [12, 100],
        rotationRange: [-90, 90],
        rotationStep: 45,
        // size of the grid in pixels for marking the availability of the canvas
        // the larger the grid size, the bigger the gap between words.
        gridSize: 8,
        // set to true to allow word being draw partly outside of the canvas.
        // Allow word bigger than the size of the canvas to be drawn
        drawOutOfBound: false,

        // if the font size is too large for the text to be displayed,
        // whether to shrink the text. If it is set to false, the text will
        // not be rendered. If it is set to true, the text will be shrinked.
        shrinkToFit: false,

        // If perform layout animation.
        // NOTE disable it will lead to UI blocking when there is lots of words.
        layoutAnimation: true,

        // Global text style
        textStyle: {
          fontFamily: 'sans-serif',
          fontWeight: 'bold',
          // Color can be a callback function or a color string
          color: function () {
            const idx = random(selectableColor.length - 1, false)
            return selectableColor[idx]
          }
        },
        // emphasis: {
        //   // focus: 'self',
        //   // textStyle: {
        //   //   textShadowBlur: 10,
        //   //   textShadowColor: '#333'
        //   // }
        // },
        data: data
      }]
    }
  }, [data])

  const [WordCloudInitialized, setWordCloudInitialized] = useState(false);

  useEffect(()=> {
    // check this https://github.com/ecomfe/echarts-wordcloud/issues/149
    // Initialize ECharts Word Cloud.
    const initWordCloud = async() => {
      await import('echarts-wordcloud');
      setWordCloudInitialized(true)
    }
    initWordCloud();
  },[])
  return (
    <div className={className}>
      {
        WordCloudInitialized ?
          <ReactECharts option={option} style={{height, width}} notMerge={true}/>
          :
          <div className={"w-full h-full min-h-40 min-w-40 bg-red-300"}>Loading...</div>
      }
    </div>
  )

}